import axios from 'axios';
import { config } from '../utils/config';

const manuallyCreateMdActions = {
  fetchInventoryInfo: (reqObj) => {
    return (dispatch) => {
      axios({
        url: '/getInventoryInfo',
        method: 'POST',
        data: reqObj,
      })
        .then((resp) => {
          dispatch({
            type: 'GET_INVENTORY_INFO',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
  fetchCadence: () => {
    return (dispatch) => {
      axios({
        url: `api.openweathermap.org/data/2.5/weather?q=London,uk&APPID=f73581a8c824fdca465e26827b303e0c`,
        method: 'GET',
        dataType: 'jsonp',
      })
        .then((resp) => {
          console.log(resp, 'responm');
          // dispatch({
          //   type: 'GET_CADENCE_DATA',
          //   payload: [resp.data.data],
          // });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },

  simulate: (reqObj) => {
    return (dispatch) => {
      axios({
        url: '/simulate',
        method: 'POST',
        data: reqObj,
      })
        .then((resp) => {
          dispatch({
            type: 'GET_MARKDOWNANALYSIS_GRAPH_DATA',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
  sendApproval: (reqObj) => {
    return (dispatch) => {
      axios({
        url: '/sendapproval',
        method: 'POST',
        data: reqObj,
      })
        .then((resp) => {
          dispatch({
            type: 'GET_INVENTORY_INFO',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
  sendDrafts: (reqObj) => {
    return (dispatch) => {
      axios({
        url: '/senddrafts',
        method: 'POST',
        data: reqObj,
      })
        .then((resp) => {
          dispatch({
            type: 'GET_INVENTORY_INFO',
            payload: resp.data,
          });
        })
        .catch((err) => {
          console.log(err);
        });
    };
  },
};
export default manuallyCreateMdActions;
